Selected_lead_1.query:
q = load "${App.Datasets.FscDemoLead.FullyQualifiedName}";
q = group q by 'ID';
q = foreach q generate 'ID' as 'ID', first('NAME') as 'NAME', coalesce(first('LEADSOURCE'),"") as 'LEADSOURCE', coalesce(first('PRODUCTINTEREST'),"") as 'PRODUCTINTEREST', first('STATUS') as 'STATUS', count() as 'count', sum('LEADAGE') as 'sum_LeadAge', case when sum('LEADAGE') >= {{cell(Average_time_to_conv_1.result, 0, "Avg days to convert").asObject()}} then "behind" else "on track" end as 'Age Status', case when sum('LEADAGE') > {{cell(Average_time_to_conv_1.result, 0, "Avg days to convert").asObject()}} then "rgb(181, 14, 3)" else "rgb(0, 181, 49)" end as 'Age Status Color', coalesce(sum('ACTIVITYTOUCHES'),0) as 'ACTIVITYTOUCHES', case when sum('ACTIVITYTOUCHES') < {{cell(Lead_metrics_1.result, 0, "Avg Activities for Conv Lead").asObject()}} then "behind" else "on track" end as 'Activity Status', case when sum('ACTIVITYTOUCHES') < {{cell(Lead_metrics_1.result, 0, "Avg Activities for Conv Lead").asObject()}} then "rgb(181, 14, 3)" else "rgb(0, 181, 49)" end as 'Activity Status Color';
q = order q by ('NAME' asc, 'LEADSOURCE' asc, 'PRODUCTINTEREST' asc, 'STATUS' asc);
q = limit q 200;

