Lead_metrics_1.query:
q = load "${App.Datasets.FscDemoLead.FullyQualifiedName}";
q_B = filter q by !('STATUS' in ["Closed - Not Converted", "Converted"]);
q_C = filter q by 'STATUS' in ["Closed - Not Converted", "Converted"];
q_D = filter q by 'STATUS' == "Converted" && 'ISCONVERTED' == "true";
q_E = filter q by 'STATUS' == "Converted";
result = group q by all full, q_B by all full, q_C by all full, q_D by all full, q_E by all;
result = foreach result generate count(q) as 'Total_leads', count(q_B) as 'Open_Leads', count(q_C) as 'Processed', count(q_D) as 'Converted', coalesce(avg(q_E.'ACTIVITYTOUCHESTOCONVERT'),0) as 'E';
result = foreach result generate 'Total_leads', 'Open_Leads', 'Processed', 'Converted', round('E',2) as 'Avg Activities for Conv Lead', coalesce(round(Converted / Processed,4)*100,0) as 'Conversion Rate1';
result = limit result 2000;

